import React from "react";
import introImage from "../assets/Intro_image.png";

function Header_intro(){
    return(
        <section className="Intro-section">
            <div className="Intro-content">
                <h2>오랫동안 일기 작성하게 만드는</h2>
                <h1>FeelsLike</h1>
                <p>
                    기분이 머무르는 순간, 당신의 하루가 특별해집니다.<br/>
                    감정에 따라 하루를 기록할 수 있는 특별한 경험을 만들어보세요.                    
                </p>
                <button className="start-btn" aria-label="Start journaling">시작하기</button>
            </div>
            <div className="Intro-image">
                <img src={'${process.env.PUBLIC_URL}/intro_image'} alt="Intro"/>
            </div>
        </section>
    );
}
export default Header_intro;
